        <div className='home'>
            <div className='container-main'>
                    <div className='container-text'>
                    <div className="title"><h4>Plan your</h4></div>
                    <div className='subtitle'><h4>perfect </h4></div>
                    <div className="title"><h4>Gateway!</h4></div>
                    </div>
